    false,nt"url": null,nt"notes": "No effects of off-refuge placer mining
    were found on the Selawik Refuge during this study. Water quality characteristics
    of rivers sampled during this study are typical of pristine calcium-magnesium bicarbonate
    systems. Water quality parameters from the Kugarak (Site 1), Selawik (Site 2), and
    Tagagawik (Site 3) rivers appear to be influenced by the wetland/lacustrine region
    in the vicinity of the sample sites. Cadmium and copper concentrations at these
    sites were slightly elevated in water samples. This may be a result of increased
    mobilization of these metals due to the lower pH and hardness at these sites. Sediment
    concentrations of arsenic, beryllium, cadmium, copper, mercury, molybdenum, and
    zinc at Sites 1, 2, 3, and 4 are characteristic of uncontaminated sediments. Although
    sediment barium concentrations are comparatively high, they are considered background
    for this area of Alaska. Consistent with findings elsewhere in Alaska, mercury concentrations
    in fish tissue from this study were somewhat elevated. However, mercury concentrations
    remained below the U.S. Food and Drug Administration action level. Two of five nickel
    concentrations in northern pike muscle tissue on the Selawik Refuge (2.1 and 25.7
    mg/kg) were elevated compared to those of other areas. Further study of nickel burdens
    in fish on the Selawik Refuge is warranted prior to drawing final conclusions based
    on these limited data. Based on the results of samples from 15 northern pike and
    5 Arctic grayling, mercury concentrations in dorsal and ventral muscle, and whole
    body analyses of these species may be used interchangeably, within each species,
    for tissue comparisons. However, we recommend comparisons based on tissues dissected
    from the same location on each fish sampled. Mercury concentrations in northern
    pike muscle were significantly higher than in Arctic grayling but within expected
    concentration ranges.",nt"license_title": "License Not Specified",nt"extras":
